import { NgModule } from '@angular/core';
import { FormsModule} from '@angular/forms';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { NavbarComponent } from './compartilhamento/navbar/navbar.component';
import { CorpoComponent } from './compartilhamento/corpo/corpo.component';
import { CriarComponent } from './paginas/criar/criar.component';
import { EditarComponent } from './paginas/editar/editar.component';
import { ConcluirComponent } from './paginas/concluir/concluir.component';
import { ExcluirComponent } from './paginas/excluir/excluir.component';
import { InicioComponent } from './paginas/inicio/inicio.component';
@NgModule({
  declarations: [
    AppComponent,
    NavbarComponent,
    CorpoComponent,
    CriarComponent,
    EditarComponent,
    ConcluirComponent,
    ExcluirComponent,
    InicioComponent,
  ],
  imports: [
    BrowserModule,
    FormsModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
